import React from 'react'
import { useState } from 'react';
const SurfSpot = (props) => {
    const spots = props.spots;
    const [surfs, setSpots] = useState([
        {title:"Honolua bay", body:"World famous surf spot", location:"Maui,Hawaii", id: 1},
        {title:"Breakwall", body:"Famous beginner surf spot", location:"Maui,Hawaii", id: 2},
        {title:"Jaws", body:"Biggest waves in the world", location:"Maui,Hawaii", id: 3}
    ]);
    console.log(props,spots)

    return (
        <div className="surf-spot"> 
            {surfs.map((spot) => (
                <div className="spot-preview" key={spot.id}>
                    console.log(spot.id)
                    <h2>{ spot.title }</h2>
                    <p> Location { spot.location }</p>
                </div>
            ))}
        </div>
    );
}

export default SurfSpot;
